def max_fill(grid, capacity):
    import math

    # Initialize variables
    total_wells = len(grid)
    total_buckets = capacity
    wells_filled = 0
    buckets_used = 0
    rows_to_fill = []

    # Find the rows that need to be filled
    for i in range(total_wells):
        if grid[i].count(1) > 0:
            rows_to_fill.append(i)

    # Fill the wells
    while len(rows_to_fill) > 0 and buckets_used < total_buckets:
        row = rows_to_fill[0]
        for i in range(total_wells):
            if grid[i][row] == 1:
                grid[i][row] = 0
                wells_filled += 1
                buckets_used += 1
                if buckets_used == total_buckets:
                    break
        rows_to_fill.remove(row)

    # Return the number of times we had to use the buckets
    return math.ceil(wells_filled / total_wells)

