def do_algebra(operator, operand):
    result = 0
    for i in range(len(operand) - 1):
        op = operator[i]
        if op == '+':
            result += operand[i] * operand[i + 1]
        elif op == '-':
            result -= operand[i] * operand[i + 1]
        elif op == '*':
            result *= operand[i] * operand[i + 1]
        elif op == '//':
            result //= operand[i] * operand[i + 1]
        else:
            raise ValueError('Unsupported operator: {}'.format(op))
    return result

